import React from 'react';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

import Navbar from './pages/Shared/Navbar';
import Home from './pages/Home/Home';

import ViewEstudiante from './pages/Estudiantes/ViewEstudiante';
import AddEstudiante from './pages/Estudiantes/AddEstudiante';
import EditEstudiante from './pages/Estudiantes/EditEstudiante';

import axios from 'axios';
axios.defaults.baseURL = "http://localhost:8000/";

function App() {
  return (
    <div className="App">
      <Router>
        <Navbar />

        <Routes>
          <Route path="/" component={Home} />
          <Route path="/estudiantes" component={ViewEstudiante} />
          <Route path="/add-estudiantes" component={AddEstudiante} />
          <Route path="/edit-estudiantes/:id" component={EditEstudiante} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
